import React from "react";
import Layout from "../Components/Layout";
import Head from "next/head";


const index = () => {
  return (
    <Layout>
        <Head>
           <title>Next project/services</title> 
           <meta name="description" content="esto es services"></meta>
        </Head>
      <h1>Index</h1>
    </Layout>
  );
};

export default index;
